import React, { Component } from 'react';
import { storeEncheres, detailEnchere } from './dataE';



 const EnchereContext = React.createContext();
//provider
//consumer

 class EnchereProvider extends Component {
   state ={
     encheres : storeEncheres,
     detailEnchere : detailEnchere
   }

   handleDetailE = () =>{
     console.log('hello from detailE');
   }

   addToCartE = () =>{
    console.log('hello from add to cartE');
  }

  render() {
    return (
      <EnchereContext.Provider  
         value={{
           ...this.state,
           handleDetailE : this.handleDetailE,
           addToCartE : this.addToCartE
         }}>
         {this.props.children}
      </EnchereContext.Provider>
    );
  }
}


const EnchereConsumer = EnchereContext.Consumer;

export { EnchereProvider, EnchereConsumer};
